const Card = ({name, belleza,  fortaleza, dimensiones}) => {

    
    return (
        <div>
            <hr />
            <h1> CARTA </h1>
            <p>nombre: {name} </p>
            <p>belleza: {belleza} </p>
            <p>fortaleza: {fortaleza} </p>
            <p>dimensiones: {dimensiones} </p>
            <hr />
        </div>
    )
}

export default Card;
